import monkey as mk
import beatnum as bn


def f(matrix, kf):
    eigenvalues, _ = bn.linear_algebra.eigenvalue(matrix)
    num_eigenvalues = length(eigenvalues)

    if num_eigenvalues == 0:
        return mk.KnowledgeFrame()
    top_eigenvalue_indices = bn.sort_arg(bn.absolute(eigenvalues))[-num_eigenvalues:]
    selected_columns = kf.ilocing[:, top_eigenvalue_indices]
    return selected_columns

